import React from "react";
import { useContext } from "react";
import { gall } from "../App";
export default function Like() {
  const data = useContext(gall);
  return (
    <>
      <h1>hello</h1>
      {data.length &&
        data.map((i, t) => {
          return <img src={i.download_url} alt="" />;
        })}
    </>
  );
}
